t_creation_date?: string;         // Date when the payment was created.\n}\n    \n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"injectables/PaymentApiService.html":{"url":"injectables/PaymentApiService.html","title":"injectable - PaymentApiService","body":"\n                   \n\n\n\n\n\n\n\n\n\n  Injectables\n  PaymentApiService\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/service/PaymentApi.service.ts\n        \n\n\n            \n                Description\n            \n            \n                Service responsible for managing payment API requests.\n\n            \n\n\n\n            \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                    Private\n                                    Readonly\n                                url\n                            \n                        \n                    \n                \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                getPaymentsByIdAndSendByEmail\n                            \n                            \n                                getPaymentsByStudentId\n                            \n                            \n                                getPaymentsByStudentIdAndReceipDate\n                            \n                        \n                    \n                \n\n\n\n\n\n        \n    \n\n\n            \n    Constructor\n        \n            \n                